import './App.css';
import Signup from './Signup';
import Profile from './Profile';

function App() {
  const getInfo = {
    valid: false,
    firstName: "",
    lastName: "",
    email: "",
    favSeason: ""
  }
  return (
    <div>
      { getInfo.valid 
        ? <Profile />
        : <Signup info={getInfo} />
      }
    </div>
  );
}

export default App;
